import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import MocionesList from './components/MocionesList';
import CreateMocion from './components/CreateMocion';
import EditMocion from './components/EditMocion';

function App() {
    const [mociones, setMociones] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/mociones')
            .then(response => response.json())
            .then(data => setMociones(data))
            .catch(error => console.error('Error fetching mociones:', error));
    }, []);

    return (
        <Router>
            <div className="container">
                <nav>
                    <Link to="/" className="nav-link">Lista de Mociones</Link>
                    <Link to="/create" className="nav-link">Agregar Moci√≥n</Link>
                </nav>
                <Routes>
                    <Route path="/" element={<MocionesList mociones={mociones} />} />
                    <Route path="/create" element={<CreateMocion />} />
                    <Route path="/edit/:id" element={<EditMocion />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
